q15_t *wrBuff = dataBuffer;
q15_t *rdBuff = dataBuffer;
uint32_t wr=0;
volatile bool dataReady = false;
lpadc_conv_result_t g_LpadcResultConfigStruct;
void drawPlot(q15_t *data, uint16_t w, uint16_t h, uint16_t color)
{
	uint16_t y=0, y1=0;
	uint16_t h2 = (h/2)-1;
	y= h2 - (uint16_t)((*data * (q31_t)h2) >> 15);
	data+=2;
	for(int x=0; x<w-1; x++) {
		y1 = y;
		y = h2 - (uint16_t)((*data * (q31_t)h2) >> 15); // Real
		data+=2;
		if(y >= h) {
			y = h-1;
		}
		if(y < 0) {
			y = 0;
		}
		LCD_Draw_Line(x, y1, x+1, y, color);
	}
}
void drawBars(q15_t *data, uint16_t w, uint16_t h, uint16_t color)
{
	uint16_t y=0;
	uint16_t h2 = h-1;
	for(int x=0; x<w; x++) {
		y = h2 - (uint16_t)(((*data++) * (q31_t)h2) >> 15);
		if(y>=h) {
			y=h-1;
		}
		if(y<0) {
			y=0;
		}
		LCD_Draw_Line(x, h2, x, y, color);
	}
}
/* C[0] = sqrt(A[0] * A[0] + A[1] * A[1]) */
void cmplx_mag_q15(q15_t *src, q15_t *dst, uint32_t len)
{
	q15_t re, im;
	for(uint32_t i=0; i<len; i++) {
		re = *src++;
		im = *src++;
		arm_sqrt_q15(((q31_t)(re*re) + (q31_t)(im*im))>>15, dst);
		*dst++ <<= 2;
	}
}
void cmplx_mag_invfc_q15(q15_t *src, q15_t *dst, uint32_t len)
{
	q15_t re, im;
	for(uint32_t i=0; i<len; i++) {
		re = *src++;
		im = *src++;
		arm_sqrt_q15((((q31_t)(re*re) + (q31_t)(im*im)) * i)>>15, dst);
		*dst++ <<= 2;
	}
}
void cmplx_win_q15(q15_t *w, q15_t *src, q15_t *dst, uint32_t len)
{
	for(uint32_t i=0; i<len; i++) {
		*(dst) = ((q31_t)*(src) * (q31_t)*w++) >> 15; // Real
		src+=2;
		dst+=2;
	}
}
/* ADC0_IRQn interrupt handler */
void ADC0_IRQHANDLER(void) {
	LPADC_GetConvResult(ADC0, &g_LpadcResultConfigStruct, 0U);
	if(!dataReady) {
		*wrBuff++ = g_LpadcResultConfigStruct.convValue - Q15_MIN; //uint16 to q15
	}
	if(wrBuff >= &dataBuffer[NFFT]){
		wrBuff = dataBuffer;
		dataReady=true;
	}
}

float calc_rms(q15_t *buffer, uint32_t length) {
	int suma = 0;

    for (uint32_t i = 0; i < length; i++) {
        suma += pow(buffer[i], 2);
    }
    float rmsV = sqrt(suma / length);
    return rmsV;
}

#define ALPHA 0.1

float filtered_rms = 0.0;

void draw_rms(float rms) {
    filtered_rms = ALPHA * rms + (1 - ALPHA) * filtered_rms;

    float log_rms = log(filtered_rms);

    float normalized_log_rms = (log_rms - log(MIN_RMS)) / (log(MAX_RMS) - log(MIN_RMS));

    if (normalized_log_rms < 0) normalized_log_rms = 0;
    if (normalized_log_rms > 1) normalized_log_rms = 1;

    float angle = PI * ((normalized_log_rms * 100 + 220) / 180.0);

    uint16_t x2 = CENTER_X + LENGTH * cos(angle);
    uint16_t y2 = CENTER_Y + LENGTH * sin(angle);

    LCD_Draw_Line(CENTER_X, CENTER_Y, x2, y2, 0xFFFF);
}

int main(void) {
	/* Disable LDOGPADC power down */
	POWER_DisablePD(kPDRUNCFG_PD_LDOGPADC);
	/* Init board hardware. */
	BOARD_InitBootPins();
	BOARD_InitBootClocks();
	BOARD_InitBootPeripherals();
#ifndef BOARD_INIT_DEBUG_CONSOLE_PERIPHERAL
	/* Init FSL debug console. */
	BOARD_InitDebugConsole();
#endif
	LCD_Init(FLEXCOMM8_PERIPHERAL);
	PQ_Init(POWERQUAD);
	arm_cfft_instance_q15 instance;
	memset(&instance, 0, sizeof(instance));
	instance.fftLen = NFFT;
	//LCD_Clear(0x0000);
	LCD_GramRefresh();
	for(int32_t i=0; i<NFFT;i++) {
		//win[i] = Q15_MAX; // Rect Window
		win[i] = ((q31_t)Q15_MAX-arm_cos_q15((Q15_MAX*i/(q31_t)(NFFT-1))))/2; // Hann Window
	}
	float rms = 0.0;
	while(1) {

		if(dataReady) {
			LCD_Clear(0x0000);
			LCD_Set_Bitmap(Vmeter);
			rms = calc_rms(dataBuffer, NFFT);
			draw_rms(rms);
			LCD_GramRefresh();
			px=x;
			pwin=win;
			rdBuff = dataBuffer;
			for(int32_t i=0; i<NFFT; i++) {
				*px++ = *rdBuff++;
				*px++ = 0;
			}
			dataReady=false;
		}
	}
	return 0 ;
}

